css:
@-moz-document url-prefix("http://www.ohmydollz.com/forum/") {

#contenu {
    background: url("http://data.nimages.fr/cannesgjo.png") no-repeat fixed 50% 0 rgba(0, 0, 0, 0);
    height: 100%;
    margin: 0;
    padding: 3px 0;
    width: 100%;
}
/*HEADER*/

#head_forum {
    background-image: url("http://data.nimages.fr/6xb.png");
    background-repeat: no-repeat;
    height: 300px;
    position: relative;
    width: 950px;
}
#head_links {
    bottom: 154px;
    left: 626px;
    position: absolute;
}
#head_links a {
    color: #FFFFFF;
    font-size: 14px;
    text-decoration: none;
}
#head_links a:hover {
    color: #b54646;
}
#brdmenu {
    background-image: url("http://data.nimages.fr/08be8.png");
    background-repeat: no-repeat;
    height: 30px;
}
#footer_box {
    background-image: url("http://data.nimages.fr/0157t6.png");
    background-repeat: no-repeat;
    height: 100px;
    width: 950px;
}

#footer_box p, #footer_box a {
    color: #A99A83;
    font-weight: bold;
    margin-top: 45px;
    padding-right: 12px;
    right: 0;
}

#brdwelcome {
    background-image: url("http://data.nimages.fr/voterrnc.png");
    background-repeat: no-repeat;
    color: #B3A690;
    font-weight: bold;
    height: 60px;
    padding: 10px;
    width: 950px;
}
.pun H2,
#brdmenu {
    background-image: url("http://data.nimages.fr/08be8.png");
    background-repeat: no-repeat;
}
.pun {
    color: #C3AB84;
}
DIV.box, .pun BLOCKQUOTE, DIV.codebox, #adminconsole FIELDSET TH, .rowodd, .roweven {
    background-color: #F5ECDC;
}
.pun BLOCKQUOTE {
    border: 1px solid #c6af8e;
}
.box {
    border: 1px solid #c3ab84;
}
.pun A:link, .pun A:visited {
    color: #A08B6A;
}
.pun A:hover {
    color: #FFFFFF;
}
DIV.block DIV.inbox, DIV.blockmenu DIV.inbox {
    padding: 0 6px;
    color: #A7977E;
}
.pun TH {
    background-image: url("http://data.nimages.fr/021ye3.png");
    background-repeat: no-repeat;
    color: #C3AB84;
    font-size: 13px;
    height: 100%;
    text-align: center;
}
.inbox tr {
    border: 1px solid #F6F2EE;
}
pun .tcr .byuser {
    color: #8A4934;
}
TD.tc2, TD.tc3, TD.tcmod, #postpreview, #viewprofile DD, DIV.forminfo, #adminconsole FIELDSET TD, DIV.blockmenu DIV.box, #adstats DD {
    background-color: #F5ECDC;
}
TD DIV.tclcon {
    color: #9C8B70;
    float: left;
    margin-left: 10px;
    width: 475px;
}
.pun .tcr .byuser {
    color: #BD0813;
}
.pun .tcr {
    border-right: 1px solid #BFAA9B;
}
DIV.postleft,
DIV.postfootleft,
DIV.blockpost LABEL {
    background-color: #C41111;
}

DIV.blockpost DIV.box {
    background-color: #f5ecdc;
}

DIV.postleft, DIV.postfootleft, DIV.blockpost LABEL {
    background-color: #C6AF8E;
    color: #F5ECDC;
}

DIV.postright, DIV.postfootright {
    background-color: #F5ECDC;
}

.pun BLOCKQUOTE {
    background-color: #F5F5DC;
}
  
DIV.postright, DIV.postfootright {
    border-left: 18em solid #C6AF8E;
}


DIV.postleft DT, DIV.postmsg H4, TD.tcl H3, DIV.forminfo H3, P.postlink, DIV.linkst LI, DIV.linksb LI, DIV.postlinksb LI, .blockmenu LI, #brdtitle H1, .pun SPAN.warntext, .pun P.warntext {
    font-weight: bold;
    color: #783418;
}

DIV.icon {
    background-image: url("http://data.nimages.fr/015tnj.png") !important;
}
DIV.inew {
    background-image: url("http://data.nimages.fr/0152od.png") !important;
}
DIV.blockpost H2 SPAN.conr {
    color: #52453C;
    text-align: right;
}
.pun H2 A:link, .pun H2 A:visited {
    color: #FFF4E1;
}
DIV.linkst .conl,
DIV.linksb .conl,
DIV.postlinksb .conl {
    width: 18em;
    color: #8E6D6A;
}
}
